import { useEffect, useState } from "react"
import axios from "axios"
import  Cookie  from "universal-cookie"
import { Loading } from "../import"
const HTransaction = () => {

    const [costumers , setCostumers] = useState([])
    const [run , setRun] = useState(0)
    const [loading , setLoading] = useState(false)
    const cookie = new Cookie()
    const token = cookie.get('bearer')
    useEffect(()=>{
        axios.get('http://127.0.0.1:8000/api/myTramsaction',{
            headers:{
                Authorization: 'Bearer '+token
            }
        }).then(res => setCostumers(res.data.data))
        //eslint-disable-next-line react-hooks/exhaustive-deps
    },[run])
    let tr = costumers.map((item,index)=>{
        return<tr key={index}>
        <td>{index + 1}</td>
        <td>{item.FromCustomer}</td>
        <td>{item.AccountNumberFrom}</td>
        <td>{item.ToCustomer}</td>
        <td>{item.AccountNumberTo}</td>
        <td>{item.balance}</td>
        <td>{item.description}</td>
        <td>{item.trans_date}</td>
        </tr>
       })
  return (
    <>
    {loading && <Loading />}
    <table dir='rtl' style={{top:"50%",maginButtom:"15px"}}>
        <thead >
            <tr>
                <th>  المعرف</th>
                <th>  المرسل</th>
                <th> رقم الحساب</th>
                <th>المستقبل</th>
                <th> رقم الحساب</th>
                <th>القيمة</th>
                <th>ملاحظات</th>
                <th>التاريخ</th>
            </tr>
        </thead>
        <tbody>
            {tr}
        </tbody>
    </table>
</>
  )
}

export default HTransaction
